import { createFeatureSelector, createSelector } from '@ngrx/store';
import { selectAll } from '../reducers/user.reducer';
import { dewormersFeatureKey } from '../reducers/dewormer.reducer';
export const selectDewormerState = createFeatureSelector(dewormersFeatureKey);
export const selectAllDewormers = createSelector(selectDewormerState, selectAll);
export const selectDewormerById = id => createSelector(selectDewormerState, state => state.entities[id]);
